def ThreeSumQuadraticTime(arr:list[int]):
    arr.sort()
    triplet = []
    for i in range(len(arr)-2):
        left = i +1
        right = len(arr)-1
        while left <= right:
            
            if arr[i] + arr[left] + arr[right] == 0:
                triplet.append([arr[i],arr[left],arr[right]])
                right -=1
                left +=1
            elif arr[i] + arr[left] + arr[right] > 0:
                right -= 1
            elif arr[i] + arr[left] + arr[right] < 0:
                left +=1
            else:
                break
    return triplet
